package com.example.foodOrderApp.config;

import com.example.foodOrderApp.entities.User; // your User entity
import com.example.foodOrderApp.repositories.UserRepository;
import org.springframework.boot.CommandLineRunner;
import org.springframework.context.annotation.Bean;
import org.springframework.context.annotation.Configuration;
import org.springframework.security.crypto.password.PasswordEncoder;

@Configuration
public class DataInitializer {

    @Bean
    CommandLineRunner createAdmin(UserRepository userRepository, PasswordEncoder passwordEncoder) {
        return args -> {
            String profileUrl="data:image/png;base64,";
            String adminEmail = "kamalesh@admin.com";
            if (userRepository.findByEmail(adminEmail).isEmpty()) {
                User admin = new User();
                admin.setFullName("Kamaleshpandi");
                admin.setEmail(adminEmail);
                admin.setPhoneNumber("9790608692");
                admin.setProfileImage(profileUrl);
                admin.setPassword(passwordEncoder.encode("kamal@123")); // change in production
                admin.setRole("ADMIN"); // your User entity probably stores role as string
                userRepository.save(admin);
                System.out.println("Created admin user -> kamalesh@admin.com / kamal@123");
            }
        };
    }
}
